import React from 'react';
import lugaflix from './imagens/lugaflix.png';
import avatar from './imagens/Netflix-avatar.png';
import './Nav.css';

function Nav() {
  return (
    <div className="nav">
        <img
            className="nav_logo"
            src={lugaflix}
            alt="Lugaflix Logo"
        />

        <img
            className="nav_avatar"
            src={avatar}
            alt="Lugaflix Logo"
        />
    </div>
  );
}

export default Nav;
